import { NavLink as Link } from 'react-router-dom';
import { FaBars } from 'react-icons/fa';
import styled from 'styled-components';

export const Nav = styled.nav`
  background: #63d471;
  height: 85px;
  display: flex;
  justify-content: space-between;
  padding: 0.2rem;
`;
